import { useUserList } from "../../../../../store/3_context";
const ContextQ2Form3 = () => {
  const [userList, setUserList] = useUserList();
  const handleReset = (e) => {
    e.reset();
  };
  return (
    <div>
      <h1>Q2Form3</h1>
      <button
        onClick={(e) => {
          handleReset(e);
        }}
      >
        RESET
      </button>
    </div>
  );
};
export default ContextQ2Form3;
